import React from "react";
import Caja from "../img/caja.png";
import "../Styles/Home.css";
const Home = () => {
  return (
    <div className="first">
      <div className="title-container">
        <h1 class="title">
          <span class="h1">&lt;h1&gt;</span>Hola, <br />
          soy Joaquín Mussi
          <span class="h1">&lt;/h1&gt;</span>
        </h1>
        <h5>
          <span class="fullstack">FullStack</span> Developer
        </h5>
        <img src={Caja} alt="" />
        <button class="info">Más Información</button>
      </div>
      <div className="image"></div>
    </div>
  );
};

export default Home;
